features.script:
const glassRight = parcel.getFeatureById('nGlassRight');
const doorRight = parcel.getFeatureById('nFrameRight');

const speed = 0.1
const movementRate = 50
const waitTime = 3000
const totalMoves = 20
let closed = true;

doorRight.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})
glassRight.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})

function start(counter){
  if(counter < totalMoves){
    setTimeout(function(){
      counter++;
      glassRight.position.x -= speed
      doorRight.position.x -= speed
      start(counter);
    }, movementRate);
  }
  if(counter == totalMoves) {
    setTimeout(function(){
      goBack(counter)  
    }, waitTime)  

  }
}

function goBack(counter) {
  if(counter > 0){
    setTimeout(function(){
      counter--;
      glassRight.position.x += speed
      doorRight.position.x += speed
      goBack(counter);
    }, movementRate);
  } else {
    closed = true
  }
}
